import '../App.css';
import Footer from './Footer';
import React from 'react';
import Navbar from './Navbar';
import Home from '../home';


import '../css/App.css';


function App() {

  return (
    <>
      <Navbar />
      <hr />
      <Switch>
              <Route exact path='/home'>
                  <Home />
              </Route>
              <Route exact path='/program'>
                  <Program />
              </Route>
              <Route exact path='/recruit'>
                  <Recruit />
              </Route>
      </Switch>
    <Footer/>
    </>
  );
};

export default App;
